import React, { useState } from 'react';
import {
  Box,
  Text,
  Badge,
  Button,
  useToast,
  VStack,
  HStack,
  Icon,
  Tooltip,
} from '@chakra-ui/react';
import { motion } from 'framer-motion';
import { FaCar, FaClock, FaCheck, FaTimes } from 'react-icons/fa';
import axios from 'axios';

const MotionBox = motion(Box);

function ParkingSpot({ id, status, lastUpdate }) {
  const [isReserved, setIsReserved] = useState(false);
  const toast = useToast();

  const handleReservation = async () => {
    try {
      await axios.post('http://192.168.1.114:3001/api/reserve-spot', { spotId: id });
      setIsReserved(true);
      toast({
        title: 'Place réservée',
        description: `La place ${id} a été réservée avec succès`,
        status: 'success',
        duration: 3000,
        isClosable: true,
        position: 'top-right',
      });
    } catch (error) {
      toast({
        title: 'Erreur',
        description: 'Impossible de réserver la place',
        status: 'error',
        duration: 3000,
        isClosable: true,
        position: 'top-right',
      });
    }
  };

  const handleCancelReservation = async () => {
    try {
      await axios.post('http://192.168.1.114:3001/api/cancel-reservation', { spotId: id });
      setIsReserved(false);
      toast({
        title: 'Réservation annulée',
        description: `La réservation de la place ${id} a été annulée`,
        status: 'warning',
        duration: 3000,
        isClosable: true,
        position: 'top-right',
      });
    } catch (error) {
      toast({
        title: 'Erreur',
        description: 'Impossible d\'annuler la réservation',
        status: 'error',
        duration: 3000,
        isClosable: true,
        position: 'top-right',
      });
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'libre':
        return 'success';
      case 'occupé':
        return 'error';
      case 'réservé':
        return 'warning';
      default:
        return 'gray';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'libre':
        return FaCheck;
      case 'occupé':
        return FaCar;
      case 'réservé':
        return FaClock;
      default:
        return FaTimes;
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return new Intl.DateTimeFormat('fr-FR', {
      hour: '2-digit',
      minute: '2-digit',
      second: '2-digit'
    }).format(date);
  };

  const bgColor = status === 'libre' ? 'white' : 
                 status === 'occupé' ? 'red.50' : 
                 status === 'réservé' ? 'orange.50' : 'gray.50';

  const borderColor = status === 'libre' ? 'green.200' : 
                     status === 'occupé' ? 'red.200' : 
                     status === 'réservé' ? 'orange.200' : 'gray.200';

  return (
    <MotionBox
      p={6}
      bg={bgColor}
      borderRadius="xl"
      boxShadow="md"
      borderWidth="2px"
      borderColor={borderColor}
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.3 }}
      whileHover={{ 
        scale: 1.02,
        boxShadow: 'lg',
        borderColor: `${borderColor}dd`
      }}
      whileTap={{ scale: 0.98 }}
    >
      <VStack spacing={4} align="stretch">
        <HStack justify="space-between" align="center">
          <Text fontSize="2xl" fontWeight="bold" color="gray.700">
            Place {id}
          </Text>
          <Tooltip label={`Dernière mise à jour: ${formatDate(lastUpdate)}`}>
            <Badge
              colorScheme={getStatusColor(status)}
              px={3}
              py={1}
              borderRadius="full"
              fontSize="sm"
              display="flex"
              alignItems="center"
              gap={2}
            >
              <Icon as={getStatusIcon(status)} />
              {status}
            </Badge>
          </Tooltip>
        </HStack>

        <Text fontSize="sm" color="gray.500">
          Dernière mise à jour: {formatDate(lastUpdate)}
        </Text>

        {status === 'libre' && !isReserved && (
          <Button
            colorScheme="brand"
            size="md"
            onClick={handleReservation}
            leftIcon={<Icon as={FaClock} />}
            _hover={{
              transform: 'translateY(-2px)',
              boxShadow: 'lg',
            }}
            _active={{
              transform: 'translateY(0)',
            }}
          >
            Réserver
          </Button>
        )}

        {isReserved && (
          <Button
            colorScheme="orange"
            size="md"
            onClick={handleCancelReservation}
            leftIcon={<Icon as={FaTimes} />}
            _hover={{
              transform: 'translateY(-2px)',
              boxShadow: 'lg',
            }}
            _active={{
              transform: 'translateY(0)',
            }}
          >
            Annuler la réservation
          </Button>
        )}
      </VStack>
    </MotionBox>
  );
}

export default ParkingSpot;
